import React from 'react';
import LetterSquare from './LetterSquare';
// import { Button } from reactstrap;

function LetterRow() {

    const green = "#6aaa64";
    const yellow = "#c9b458";
    const grey = "#787c7e";

    return (
        <div
        display="flex"
        flex-direction="row"
        >
            <LetterSquare letter="A" color={green} />
            <LetterSquare letter="B" color={green} />
            <LetterSquare letter="c" color="white" />
            <LetterSquare letter="d" color={yellow} />
            <LetterSquare letter="E" color={grey} />
        </div>
    )
}

export default LetterRow;
